window.bookSummaryJSON = "<p>The <i>Focus</i> workshop presents an engaging and inspirational learning experience and will change your life in ways you never thought possible. </p> <p>With this audiobook, you will begin a process and journey to a new way of thinking about personal and professional focus and accomplishment. You'll learn how to identify and focus on the tasks and priorities that matter most so that you can deliver maximum results every day. </p> <p>You'll learn to turn the things you have to do into the things you want to do. Dr. Covey and master facilitator Steve Jones introduce you to the FranklinCovey workshop that has already helped 10 million people become more productive.</p>"; 
